CREATE TABLE `stocks_tbl` (
  `stocks_id` int(15) NOT NULL AUTO_INCREMENT,
  `item_id` int(15) NOT NULL,
  `unit_id` int(15) NOT NULL,
  `unitsissued` int(5) NOT NULL,
  `quantity` int(5) NOT NULL,
  PRIMARY KEY (`stocks_id`),
  KEY `item_id` (`item_id`),
  KEY `unit_id` (`unit_id`),
  CONSTRAINT `stocks_tbl_ibfk_1` FOREIGN KEY (`item_id`) REFERENCES `item_tbl` (`item_id`),
  CONSTRAINT `stocks_tbl_ibfk_2` FOREIGN KEY (`unit_id`) REFERENCES `unit_tbl` (`unit_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1961 DEFAULT CHARSET=latin1;






